import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Homepage from './Homepage';
import Shop from './Shop';
import Layout from './Layout';

function App() {
  return (
    <Router>
      <Layout>
        <Switch>
          <Route exact path="/">
            <Homepage />
          </Route>
          <Route path="/shop">
            <Shop />
          </Route>
        </Switch>
      </Layout>
    </Router>
  );
}

export default App;
